description:
We know who you did last summer!
Sin City's ultra super-hottie Nikki Lynn and a few of her closest friends reunite for a labor day weekend straight outta heaven! Nikki throws caution (and her clothes) to the wind and heads for Lake Mead, with just one thing one her mind: sex, sex, and more sex! Join Nikki, Alexa, Syren and Jessica as they give a whole new meaning to the phrase &quot;sun stroke&quot;.

